import React, { Component } from 'react'

 class UserGreeting extends Component {
     constructor(props) {
         super(props)
     
         this.state = {
              isLoggedIn:'false'
         }
     }
     
    render() {
        if (this.state.isLoggedIn) {
            return (
                <div><h1>Welcome Daniel</h1></div>
            )
        }
        return (
            <div>
               <div><h1>Welcome Daniel</h1></div> 
               <div><h1>Welcome Guess</h1></div> 

            </div>
        )
    }
}

export default UserGreeting
